import React from 'react';
import TrainingChatView from './TrainingChatView';
import { TrainingThread } from '../../shared/types';

interface ProceedViewProps {
  personaId: string;
  personaName: string;
  proceedContent: string;
  threads: TrainingThread[];
  onThreadUpdate: (threads: TrainingThread[]) => void;
  selectedThread?: TrainingThread | null;
  onRefreshThreads?: () => void;
}

const ProceedView: React.FC<ProceedViewProps> = (props) => {
  return (
    <TrainingChatView
      viewType="proceed"
      personaId={props.personaId}
      personaName={props.personaName}
      initialContent={props.proceedContent}
      threads={props.threads}
      selectedThread={props.selectedThread || null}
      onThreadUpdate={props.onThreadUpdate}
      onRefreshThreads={props.onRefreshThreads}
      // 여기에 추가적으로 필요한 prop들을 전달합니다.
    />
  );
};

export default ProceedView;
